<script lang="ts">
	import { navigating } from '$app/stores';
	import { onDestroy } from 'svelte';

	let rotation = 0;
	let interval: NodeJS.Timeout | undefined;

	navigating.subscribe((value) => {
		if (value !== null) {
			interval = setInterval(() => {
				rotation += 1;
			}, 1);
		} else if (interval) {
			clearInterval(interval);
			interval = undefined;
		}
	});

	// Cleanup on component destroy
	onDestroy(() => {
		if (interval) {
			clearInterval(interval);
		}
	});
</script>

